import './home.css';
import { Link } from 'react-router-dom';
import Button from '@material-ui/core/Button';
import tile1 from '../../images/IMG-3163.jpg';
import { makeStyles } from '@material-ui/core/styles';

export default function AboutUsLinks() {

    const useStyles = makeStyles((theme) => ({
      img1: {
        'background-image': "url('../../images/IMG-3163.jpg')",
      },
      img2: {
        'background-image': "url('../../images/IMG-3163.jpg')",
      },
      img3: {
        'background-image': "url('../../images/IMG-3163.jpg')",
      }
    }))

  const classes = useStyles();

   return (
    <div className="aboutContainer">
        <div className="circleCont1">
        <Link to="/store"> 
          <div className="circleImg1"/>
        </Link>
        </div>
        <div className="circleCont2">
        <Link to="/store">  
          <div className="circleImg2"/>
        </Link>
        </div>
        <div className="circleCont3">
        <Link to="/store">  
          <div className="circleImg3"/>
        </Link>
        </div>
    </div>
  );
}
